INSERT INTO `oc_category_description` VALUES (87,4,'Anel de formatura','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Anel de formatura','',''),(88,4,'Atêlie e Fábrica','&lt;p&gt;A exclusividade é o foco dos nossos artesãos, todo o requinte da ourivesaria alinhado com a praticidade da fábrica.&lt;/p&gt;&lt;p&gt;Momentos especiais, merecem ser presenteados e eternizados, e nada melhor do que uma jóia exclusiva, desenvolvida com muito amor, carinho e dedicação para simbolizar esse momento único.&lt;/p&gt;&lt;p&gt;Trabalhamos com os melhores profissionais do mercado, a ourivesaria, transformada em tradição, passada de geração em geração, com mais de 60 anos de experiência. OuroAF, com uma linguagem moderna e atual. Que tem como objetivo eternizar os momentos especiais.&lt;/p&gt;&lt;p&gt;O ouro, com sua utilização desde 2500 A.C., faz parte de nossa matéria prima, e é nela que colocamos nossas ideias e criamos nossos produtos, sempre com muita dedicação e respeito.&lt;/p&gt;&lt;p&gt;Temos também como nossos clientes, satisfeitos, alunos das principais faculdades do Brasil.&lt;/p&gt;&lt;p&gt;Conheça o nosso trabalho. &lt;a href=&quot;http://ouroaf.homolog.lojavirtual.digital/index.php?route=information/contact&quot; target=&quot;_blank&quot;&gt;Solicite um profissional para atende-lo&lt;/a&gt;.&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;/noticia123&quot; target=&quot;&quot;&gt;&lt;img src=&quot;http://ouroaf.homolog.lojavirtual.digital/image/catalog/banner-2.jpg.2.bak.jpg&quot;&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Atêlie e Fábrica','',''),(92,4,'University','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','University','',''),(93,4,'Mackenzie','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Mackenzie','',''),(94,4,'Direito Mack Julho 2018','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Direito Mackenzie','',''),(98,4,'Direito Mack Dezembro 2018','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Direito Mackenzie','','Mackenzie, Direito, Direito Mackenzie, Anel de formatura'),(99,4,'Direito Mack Dezembro 2017','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Direito Mackenzie','','Mackenzie, Direito, Direito Mackenzie, Anel de formatura'),(100,4,'Damásio','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Damásio','',''),(101,4,'Direito Damásio 2017','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Direito Damásio 2017','',''),(102,4,'Engenharia Mack Julho 2017','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Eng Mack','',''),(103,4,'Engenharia Mack Dezembro 2016','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Eng Mack','',''),(104,4,'Politécnica USP','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Poli-USP','',''),(105,4,'Politécnica 2017','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Poli 2017','',''),(89,4,'Coleção Deuses','','Coleção Deuses','',''),(90,4,'Masculino','','Masculino','',''),(91,4,'Feminino','','Feminino','',''),(106,4,'Politécnica 2016','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Poli-USP','',''),(107,4,'Faculdade de Direito USP','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','FDUSP','',''),(108,4,'SANFRAN 185','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','SANFRAN 185','',''),(109,4,'SANFRAN 186','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','SANFRAN 186','',''),(110,4,'SANFRAN 187','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','SANFRAN 187','',''),(111,4,'PUC','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','PUC','',''),(112,4,'Direito PUC 2016','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Direito PUC 2016','','');
